import React from "react";
import styled from "styled-components";
const Home = () => {
  return (
    <>
      <HomeWrapper>
          <SideMenu>
                    + new chat
          </SideMenu>
      </HomeWrapper>
    </>
  );
};

const HomeWrapper = styled.div`
  width: 100vw;
  height: 100vh;
  background-color: rgba(52, 53, 65, 1);
`;

const SideMenu = styled.aside`
  width: 240px;
  height: 100vh;
  background-color: #202123;
  color: #fff;
`;
export default Home;
